RETURNS int(11)
DETERMINISTIC
BEGIN
  DECLARE LISTA_DE_PRODUCTOS int;
  SELECT
    cantidad INTO lista_de_productos
  FROM stock
    INNER JOIN productos
      ON stock.Producto_ID = productos.ID_Producto
  -- UNIMOS LAS TABLAS stock Y productos POR MEDIO DEL ID_PRODUCTO QUE ES PARTE DE LA TABLA stock
  WHERE marca = f_MARCA
  AND modelo = f_MODELO;
