--
-- Create function `FN_Gar`
--
CREATE DEFINER = 'root'@'localhost'
FUNCTION FN_Gar (f_Recibo_ID char(255), f_Cliente_ID char(255))
RETURNS int(11)
DETERMINISTIC
BEGIN
  DECLARE Garantia_Cliente int;
  SELECT
    Fecha_De_Compra INTO Garantia_Cliente
  FROM garantia
    INNER JOIN recibo
      ON garantia.Recibo_ID = recibo.ID_Recibo -- UNIMOS LAS TABLAS garantia Y recibo POR MEDIO DEL ID_Recibo QUE ES PARTE DE LA TABLA recibo
    INNER JOIN cliente
      ON garantia.Cliente_ID = cliente.ID_Cliente-- UNIMOS LAS TABLAS garantia Y cliente POR MEDIO DEL ID_Cliente QUE ES PARTE DE LA TABLA recibo
  WHERE ID_Recibo = f_Recibo_ID
  AND ID_Recibo = f_Cliente_ID; -- VAMOS A CONSULTAR SI EL CLIENTE TIENE GARANTIA  
  RETURN Garantia_Cliente;
END
$$

--
-- Create procedure `PS_Gar`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE PS_Gar (IN ID_Recibo int, IN ID_Producto int, IN ID_Provincias int, IN ID_Cliente int, IN ID_Localidad int, IN Fecha_de_compra int, IN Inicio_Garantia int, IN Fin_garantia int)
BEGIN
    -- INGRESAMOS LOS DATOS SELECCIONAMOS LA TABLA Y DEFINIMOS EN QUE CAMPOS VAMOS A INGRESAR ESOS DATOS
    VALUES (ID_Recibo, ID_Producto, ID_Provincias, ID_Cliente, ID_Localidad, Fecha_de_compra, Inicio_Garantia, Fin_garantia); -- DEFINIMOS QUE VALORES INGRESAMOS DE LOS DATOS QUE DEFINIMOS
END
$$

